import React, { Component } from 'react';
import './TeamRoster.css';

const apiServer = "http://localhost:8080";

class TeamRoster extends Component {
    constructor(props){
        super(props);
        this.state = {
            roster: [],
            viewingPlayerID: null
        };
    }

  // componentWillMount(){}
    componentDidMount() {
        console.log("TeamRoster mounted")
        fetch(apiServer+"/nba/players")
        .then(res => res.json())
        .then(
            (result) => {
                this.setState({
                    isLoaded: true,
                    roster: result
                });
            },
            // Note: it's important to handle errors here
            // instead of a catch() block so that we don't swallow
            // exceptions from actual bugs in components.
            (error) => {
                this.setState({
                    isLoaded: true,
                    error
                });
            }
        ).catch((err) => {
            console.log(err);
        })
    }

    // componentWillUnmount(){}
    // componentWillReceiveProps(){}
    // shouldComponentUpdate(){}
    // componentWillUpdate(){}
    // componentDidUpdate(){}

    viewPlayerDetails = (e) => {
        const {value} = e.target
        this.setState({ viewingPlayerID: value });
    }

    render() {

        const rosterRows = this.state.roster.map((player) => {
            return (
                <tr key={player.id}>
                    <td>{player.firstName} {player.lastName}</td>
                    <td>{player.position}</td>
                    <td><button value={player.id} onClick={this.viewPlayerDetails}>Details</button></td>
                    {/*
                    <td>{player.age}</td>
                    <td>{player.height}</td>
                    <td>{player.weight}</td>
                    <td>{player.college}</td>
                    <td>{player.salary}</td>*/
                    }
                </tr>
            )
        })

        return (
        <div>
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Position</th>
                            <th></th>
                            {/*<th>Height</th>
                            <th>Weight</th>
                            <th>College</th>
                            <th>Salary</th>*/
                            }
                        </tr>
                    </thead>
                    <tbody>{rosterRows}</tbody>
                </table>
            </div>
            {
            (this.state.viewingPlayerID !== null) ? <PlayerDetail playerId={this.state.viewingPlayerID}/> : null
            }
        </div>
        );
    }
}

class PlayerDetail extends Component {
    constructor(props) {
        super(props);
        this.state = {
            player: null,
            prevPlayerId: null
        }
    }

    fetchPlayer() {
        fetch(apiServer+"/nba/players/"+this.props.playerId)
        .then(res => res.json())
        .then(

            (result) => {
                this.setState({
                    isLoaded: true,
                    player: result,
                    prevPlayerId: this.props.playerId
                });
            },
            // Note: it's important to handle errors here
            // instead of a catch() block so that we don't swallow
            // exceptions from actual bugs in components.
            (error) => {
                this.setState({
                    isLoaded: true,
                    error
                });
            }
        ).catch((err) => {
            console.log(err);
        })
    }

    componentDidMount() {
        this.fetchPlayer();
    }

    shouldComponentUpdate() {
        console.log(this.state.prevPlayerId, this.props.playerId)
        return this.state.prevPlayerId !== this.props.playerId;
    }

    render(){


        let salaryStr = "";
        if (this.state.player) {
            let salary = this.state.player.salary.toString();
            let charCnt = 0;
            for (let i=salary.length-1; i>=0; i--) {
                if (charCnt > 0 && charCnt % 3 === 0) {
                    salaryStr = "," + salaryStr;
                }
                salaryStr =  salary.charAt(i) + salaryStr;
                charCnt++;
            }
        }


        if (!this.state.player) {
            return (null);
        }

        return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Position</th>
                        <th>Age</th>
                        <th>Height</th>
                        <th>Weight</th>
                        <th>College</th>
                        <th>Salary</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{this.state.player.firstName} {this.state.player.lastName}</td>
                        <td>{this.state.player.position}</td>
                        <td>{this.state.player.age}</td>
                        <td>{this.state.player.height}</td>
                        <td>{this.state.player.weight}</td>
                        <td>{this.state.player.college}</td>
                        <td>${salaryStr}</td>
                    </tr>
                </tbody>
            </table>
        </div>
        );
    }
  }

export default TeamRoster;
